import React from 'react';

function Header() {
  return (
    <header>
      <h1>BookBliss</h1>
      <nav>
        <a href="#products">Products</a>
        <a href="#cart">Cart</a>
        <a href="#checkout">Checkout</a>
      </nav>
    </header>
  );
}

export default Header;
